  false,\n\t\"url\": null,\n\t\"notes\": \"The University of Alaska, Institute of
  Marine Science is responsible fornthis data collected aboard the R/V Alpha Helix
  on cruise number HX118nbetween September 14, 1988 to September 29, 1988 by Dr. T.C.
  Royer ofnthe Institute of Marine Science. There was a total of 77 stations in thenGulf
  of Alaska. The station numbers are: 1-77. Field correction for thisncruise was taken
  from Alpha Helix cruise HX118. Field correction for thenSTD data was derived by
  comparing single bottle samples to recordednvalues from the STD sensors. The field
  correction is based on 9 samplesnfrom a total of 11 stations. The CTD data is stored
  in F022 format innthe current NODC storage system.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
